				<Card.Title>Title</Card.Title>
				<Card.Body> Some quick example text to build on the card title and make up the bulk of the card's content.</Card.Body>
				<Button variant="primary">Go somewhere</Button>
			</Card>

			</div>
		</div>

	);
};

export default Home;
